import React from 'react';
import './BorderGradient.scss';

export default function BorderGradient() {
  return (
    <>
      <div className="border-gradient --first"></div>
      <div className="border-gradient --second"></div>
      <div className="border-gradient --third"></div>
      <div className="border-gradient --fourth"></div>
    </>
  );
}
